import { toast } from "react-toastify";
import { ACCESS_TOKEN } from "../constants";
import { useHistory } from "react-router-dom";

function Logout() {
  const history = useHistory();

  localStorage.removeItem(ACCESS_TOKEN);
  toast.success
  history.push("/login");
  return null;
}

export default Logout;
